import React from 'react';
import ReactDOM from 'react-dom';

function Card(props) {
    return(
        <>
        <div className='cards'>
          <div className = 'card'>
            <img src='' alt = 'moviePic' className ='card_img' />
            <div className='card_info'>
                <span className='card_category'> </span>
                <h3 className='card_title'>  </h3>
                <a href='https://www.netflix.com/bd/title/81002370' target='_blank'>
                    <button>Watch Now</button>
                </a>
            </div>
          </div>
        </div> 
    </>
    );
}

export default Card;
